void cmpy_complex_top::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst_n\" :  \"" << ap_rst_n.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"sig_TDATA\" :  \"" << sig_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"sigRef_TDATA\" :  \"" << sigRef_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"prealign_V_TDATA\" :  \"" << prealign_V_TDATA.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"cmp_TDATA\" :  \"" << cmp_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"nL\" :  \"" << nL.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"nLExp\" :  \"" << nLExp.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"nLen\" :  \"" << nLen.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"factor_V\" :  \"" << factor_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"sigRef_TVALID\" :  \"" << sigRef_TVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sigRef_TREADY\" :  \"" << sigRef_TREADY.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"prealign_V_TVALID\" :  \"" << prealign_V_TVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"prealign_V_TREADY\" :  \"" << prealign_V_TREADY.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"sig_TVALID\" :  \"" << sig_TVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sig_TREADY\" :  \"" << sig_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"cmp_TVALID\" :  \"" << cmp_TVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"cmp_TREADY\" :  \"" << cmp_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

